window.bookSummaryJSON = "<p>The hot, dominant vampire god and I have a bad history together, one I can’t remember and he can’t let go.</p> <p>I won’t deny the scorching heat and attraction between us, but I’ll be a fool to surrender to Marlowe’s seductive and destructive power.</p> <p>And we have a bigger problem.</p> <p>War, the third horseman who refused to leave Earth, has set his sight on me.</p> <p>If Marlowe can’t forgive my sins and I can’t trust him again, War will take me and terror will reign on Earth.</p> <p><b><i>Vampire God</i></b><b> is the second book in this spicy wolf shifter and vampire romance trilogy. If you like enemies-to-lovers, fated mates, obsessive psycho alphas, and tough, hilarious heroine, you’ll enjoy this series.</b></p>"; 
